INSERT INTO "public"."admin_rol" VALUES ('1', 'Administrador de contenido', 'Tiene acceso a los módulos del backend y es el encargado de administrar los contenidos que se mostrarán en el frontend, así como de consultar múltiples reportes.');
INSERT INTO "public"."admin_rol" VALUES ('2', 'Alumno(a)', 'Niño(a) que podrá entrar a la interfaz del frontend a revisar y ejecutar los ejercicios propuestos por cada unidad de los libros que tenga asociados.');
INSERT INTO "public"."admin_rol" VALUES ('3', 'Profesor(a)', 'El docente podrá observar el mismo contenido que su alumnado revisa, con algunas funcionalidades adicionales y el monitoreo del progreso de su clase.');
INSERT INTO "public"."admin_rol" VALUES ('4', 'Revisor', 'Este rol permite acceder a todos los contenidos y elementos contemplados en el frontend. Su traza en los registros no debe ser tomado en cuenta en los reportes.');
